<h5>ED-00013: American National Election Studies Data</h5>
<p>This dataset contains the results of the <a href="http://www.electionstudies.org/">American National Election Studies</a> thermometer polls taken between 1970 and 2008 (not including 2006).  The data presented here was derived by datasets assembled by <a href="http://www.econ.vt.edu/faculty/facultybios/tidemanbio.htm">Nicolaus Tideman</a> and <a href="http://www2.binghamton.edu/economics/people/plassmann.html">Florenz Plassmann</a>.</p> <p>Respondents (voters) were asked to give a numerical ranking between 0 and 97 for each of a number of candidates running each year.  Respondents were allowed to state that they did not know or would not respond to ranking certain candidates.  Therefore these are incomplete partial orders and have been converted to <b>toi</b> datasets.  Additionally we have extended these into <b>toc</b> files by placing all unranked candidates tied, at the end of the order.  There are between 3 and 12 candidates in the various datafiles and between 1,208 and 2,648 voters.</p>

<p><h6>Required Citations</h6><p><ul> 
<li>None.</li></ul></p>

<p><h6>Selected Citations Using This Dataset</h6><p><ul> 
<li> <a href="http://scholar.google.com/scholar?as_q=Modeling+the+outcomes+of+vote-casting+in+actual+elections">Modeling the outcomes of vote-casting in actual elections.</a> N. Tideman and F. Plassmann. In: Dan Felsenthal and Mose Machover (eds.) Electoral systems: Paradoxes, assumptions, and procedures. Springer, 217 - 251, 2012. </li>
<li> <a href="http://scholar.google.com/scholar?as_q=Which+Voting+Rule+is+Most+Likely+to+Choose+the+Best+Option?">Which Voting Rule is Most Likely to Choose the Best Option?.</a> N. Tideman and F. Plassmann. Public Choice, 2013. </li>
<li> <a href="http://scholar.google.com/scholar?as_q=How+frequently+do+different+voting+rules+encounter+voting+paradoxes+in+three-candidate+elections?">How frequently do different voting rules encounter voting paradoxes in three-candidate elections?.</a> N. Tideman and F. Plassmann. Social Choice and Welfare, 2013. </li>
</ul></p>

